Big s/o to all the brands, organizations and friends who all stepped up for my Own The Wave Block Party x Community Resource Fair! 

We provided backpacks, sneakers, food vouchers, prizes, game trucks, arts & crafts and an overall great vibe for the kids to end the summer. 

We also had local community organizations in attendance to inform the residents of resources they might not have privy to.

In such a transactional climate It’s so refreshing to see folks pour back into the community with no hesitation. 

Let’s keep this momentum and show the kids that #YouCanDoItToo 🌊

This was a very important task for me and i wouldn’t have pulled it off without the help and support of my people. Thank you! 

